import React from 'react';
import SiderProfile from './SiderProfile.jsx';
import Post from './Post.jsx';
import { Row, Col } from 'antd';
import CreatePost from './CreatePost.jsx';
import { useSelector, useDispatch } from 'react-redux';

function TimeLine({ myPosts }) {
  const { listPosts, loading, error, hasMore, loadingAddComment } = useSelector(state => state.myPosts);

  const submitCreatePost = (valueEditor, fileList, privacyNewFeed, privacyStory, placeNewFeed, placeStory, listMention) => {
    console.log(valueEditor, fileList, privacyNewFeed, privacyStory, placeNewFeed, placeStory, listMention);
  }
  return (
    <>
      <Row>
        <SiderProfile />
        <Col span={16} style={{ paddingLeft: '20px' }}>
          <CreatePost submitCreatePost={submitCreatePost}/>
          {listPosts.map((post, index) => <Post key={index} post={post} />)}
        </Col>
      </Row>
    </>
  )
}

export default TimeLine;
